import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Cadastro from "./pages/Cadastro";
// 1. Importe o componente Navbar
import Navbar from "./components/Navbar.js"; 
// Certifique-se de que o caminho para Navbar.js está correto

function App() {
  return (
    <Router>
      {/* 2. Navbar no topo: Renderizada acima de todo o conteúdo */}
      <Navbar /> 

      <Routes>
        <Route path="/" element={<Home />} />
        {/* As páginas de Login e Cadastro serão centralizadas através das suas classes internas */}
        <Route path="/login" element={<Login />} />
        <Route path="/cadastro" element={<Cadastro />} />
      </Routes>
    </Router>
  );
}

export default App;
